import { combineReducers } from "redux";
import contacts from "./contactReducer";
import filter from "../reducer/filterReducer";
import alert from "../reducer/alertReducer";
const contactsRreducer = combineReducers({
  contacts,
  filter,
  alert,
});

const rootRreducer = combineReducers({ contacts: contactsRreducer });

export default rootRreducer;
